import React from "react";
import Navbar from 'react-bootstrap/Navbar';
import RadioButtonList from "../radio-button";

const DropDownMenu = () => {
    return (
        <React.Fragment>
            <Navbar.Collapse id="basic-navbar-nav">

                <Nav className="mr-auto">
                    <RadioButtonList/>
                </Nav>
            </Navbar.Collapse>

        </React.Fragment>
    );
}


export default DropDownMenu;
